var fizzBuzz = function(x){
    if(x%15==0){
        return "Fizzbuzz";
    }
    if(x%3==0){
        return "Fizz";
    }
    if(x%5==0){
        return "Buzz";
    }
    return x;
};

var mainFunction = function(start,stop){
    var str="";
    for(var i=start; i < stop; i++){
        str += fizzBuzz(i) + ", ";
    }
    return str;
};